				ELSE cattle_info_tbl.cow_age>=2
			END
	AND 
		CASE calf_sex
			WHEN 4 THEN cattle_info_tbl.sex IN (0,1,2,3)
			ELSE cattle_info_tbl.sex=calf_sex
		END;
